  },
  methods: {
    tabClick (type) {
      this.active_menu=type
      this.$router.push({
        name: type
      })
    },
    showPCCMenu() {
      let that = this
      let userAgent = navigator.userAgent.indexOf('Linux; Android 6.0').toString()
      if(userAgent == '-1'){
        that.showPCMenu = true
      }
    },
    showMenuPC() {
      let that = this
      if(that.showPCMenu == false){
        that.showPCMenu = true
      }
    },
    closeBtn() {
      this.hideMBMenuClass = "showMenu slide-left-leave-active";
      this.showMBMenu = false;
      setTimeout(() => {
        this.hideMBMenuClass = "showMenu";
      }, 1000);
    },
    mylog() {
      this.$store.commit("setTimer", true);
    },
    toView(index, router) {
      this.tabIndex = index;
      if (!router) {
        // this.$Toast('暂无页面')
      }
      this.$router.push({
        name: router
      });
    },
    go2Jumb(item) {
      if (item.isConfig) {
        return window.open(`${item.url}`);
      }
      window.open(item.url);
    },
    reload() {
      this.isRouterAlive = false;
      this.$nextTick(() => {
        this.isRouterAlive = true;
      });
    },
    changeTabIndex(type, index, ind) {
      if (type == "MB") {
        this.hideMBMenuClass = "showMenu slide-left-leave-active";
        this.showMBMenu = false;
      } else {
        this.showPCMenu = false;
      }
      if (this.tabIndex === index && ind === undefined && index !== 2) {
        return;
      } else if (
        this.tabIndex === index && index == 2 && this.$router.currentRoute.name === "loginIn"
      ) {
        return;
      } else if (
        this.tabIndex === index &&
        ind === undefined &&
        index === 2 &&
        this.$route.query.type == undefined
      ) {
        return;
      } else if (index === 2 && !this.ifLogin) {
        this.$message.error("您還未登入，請先登入！");
        return this.$router.push({ name: "loginIn" });
      }
      if (parseInt(this.$route.query.type - 1) == ind) return;
      let query = {};
      if (
        this.tabArr[index].child.length > 0 &&
        index === 2 &&
        ind !== undefined
      ) {
        query = {
          [this.tabArr[index].child[ind].param]: [
            this.tabArr[index].child[ind].value
          ]
        };
      }
      if (this.tabArr[index].path == "help") {
        this.$router.push({ path: `${this.tabArr[index].path}/1`, query });
      } else {
        this.$router.push({ path: this.tabArr[index].path, query });
      }
    },
    onClick() {
      console.log(`click`);
    },
    test() {
      let url =
        "https://www.baidu.com/s?ie=utf-8&f=8&rsv_bp=1&tn=baidu&wd=ant%20design%20vue%20%20%E7%BB%84%E4%BB%B6%E6%8A%A5%E9%94%99%20Uncaught%20(in%20promise)&oq=ant%2520design%2520vue%2520%25E7%25BB%2584%25E4%25BB%25B6%25E6%258A%25A5%25E9%2594%2599vue-router.esm.js%253Fecb4%253A2051%2520Uncaught%2520(in&rsv_pq=f9ad28060001a63f&rsv_t=d183eXCvMkOgpLUJ85%2FHPR7BwnOwiWy2joGrwbvHGP%2BoylSSbr9dwKiXKSc&rqlang=cn&rsv_enter=0&rsv_dl=tb&inputT=8447&rsv_sug3=15&rsv_sug4=11012";
      var tempwindow = window.open("_blank"); // 先打开页面
      tempwindow.location = url; // 后更改页面地址
      // window.open(url)
      // if (this.showMenu) return
      // this.showMenu = !this.showMenu
    },
    go2Router(r) {
      this.active_menu=r
      if (this.showPCMenu) this.showPCMenu = false;
      if (this.showMBMenu) {
        this.hideMBMenuClass = "showMenu slide-left-leave-active";
        this.showMBMenu = false;
      }
      if (this.$router.currentRoute.name === r) return;
      this.$store.commit("setTabIndex", null);
      this.$router.push({
        name: r
      });
    },
    logout() {
      this.hideMBMenuClass = "showMenu slide-left-leave-active";
      this.showMBMenu = false;
      this.$myToast.error("您確定要登出嗎？");
      // this.$confirm({
      //   title: '退出登錄提示',
      //   content: '您確定要退出登錄吗？',
      //   onOk: () => {
      //     // this.logOut()
      //     this.$store.dispatch('logOut')
      //   },
      //   onCancel() {},
      // });
    },
    clientInit() {
      let scroll = this.getScrollWidth()
      let that = this
      let widths = document.body.clientWidth+scroll

      if ( (widths > 1023)&&(that.iftb=='insure')) {
        console.log('ll投保流程页')
        that.show_footer = false

      } else {
        that.show_footer = true
        var is_loginResult = that.arrNoFooter.some(function(item) {
          if(that.$route.path=='/pages/personal-info'){
          if(that.$route.query.type){
            return false
          }
        }
        else if(that.$route.path ==item){
          if(that.$route.query.type){
            return false
          }else {
            return true

          }
        }
      })
      if ((widths < 1024)&&is_loginResult)  {
        that.is_h5 = false
        }else {
         if(that.$route.path=='/pages/personal-info'){
            if(that.$route.query.type){
            that.is_h5 = false
          }else {
            that.is_h5 = true
          }
        }
        }

      }
      let aspectRatio = document.body.clientHeight / widths
      that.getHtmlFontSizeValue = false
      if(aspectRatio < 1.775){  //iphone 5s 高/宽
        if(that.getHtmlFontSizeValue == false){
          that.htmlFontSize = 16 * document.body.clientHeight / 568
          that.getHtmlFontSizeValue = true
        }
        that.noBreadScale = true
      } else{
        that.getHtmlFontSizeValue = false
        that.noBreadScale = false
      }
    },
    getScrollWidth() {
      var noScroll, scroll, oDiv = document.createElement("DIV");
      oDiv.style.cssText = "position:absolute; top:-1000px; width:100px; height:100px; overflow:hidden;";
      noScroll = document.body.appendChild(oDiv).clientWidth;
      oDiv.style.overflowY = "scroll";
      scroll = oDiv.clientWidth;
      document.body.removeChild(oDiv);
      return noScroll-scroll;
    },
    is_TB (to){
      this.clientInit()
      let menu=to.path.split("/")[2];
      if(menu==='personal-info'){
        this.active_menu='infoChange'
      }else if(menu==='activity'){
        this.active_menu='active'
      }else{
        this.active_menu=menu
      }
      let that = this
      // var result =this.is_not_showbottom(that.arr)
      var result = this.arr.some(function(item) {
        if(to.path=='/pages/personal-info'){
          if(to.query.type){
            return true
          }
        }else{
          if ((item == to.path)) {
            return true
          }
        }
      })
      
      if (result) {
        that.is_tb = false
      } else {
        that.is_tb = true
      }
      // var is_loginResult =this.is_not_showbottom(this.arrNoFooter)
      var is_loginResult = this.arrNoFooter.some(function(item) {
        //对会员专区做特殊处理
        if(to.path =='/pages/personal-info'){
          if(to.query.type){
            return true
          }
        }else {
          if (item == to.path) {
            return true
          }
        }
      })
      let scrollWidth = this.getScrollWidth()
      if(!is_loginResult && document.body.clientWidth+scrollWidth < 1024){  //1023
        that.is_login = true
      }else if(is_loginResult && document.body.clientWidth+scrollWidth > 1023){ //1024
        that.is_login = false
      }else{
        that.is_login = false
      }
    }
  },
  watch: {
    aspectRatio (to, from) {
      this.clientInit()
    },
    $route(to, from) {
      this.is_TB(to)

    },
    ifLogin(n, o) {
      let timer = {};
