      that.clientHeight = document.body.clientHeight
      that.clientWidth = document.body.clientWidth + that.getScrollWidth()
      that.aspectRatio = that.clientHeight / that.clientWidth
      if(that.clientWidth<1023) {
        that.is_h5 = true
      }else {
        that.is_h5 = false
      }
    })
    window.addEventListener("scroll", function() {
